import React from 'react';
import '../../../App.css';
import FGB from './FGB';
import Stage_Foch from './Stage_Foch';
import GATE_AFM from './GATE_AFM';

export default function CV() {
  return ( 
    <>
    &nbsp;
    <div style={{textAlign: "center"}}>
      <h1>
        <u>
        More details about my CV
        </u>
      </h1>
    </div>
    <FGB/>
    <Stage_Foch/>
    <GATE_AFM/>
  </>
  );
}
